import React, { Component } from 'react';
import Header from './Header';

export default class index extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <p>o Hi mark</p>
        <Header />
      </div>
    );
  }
}
